import React from 'react';
import PropTypes from 'prop-types';

const Navbar = (props) => {
    return(
        <h1 style = {{color:"red", textAlign:"center"}} >{props.title}</h1>
    )
}

Navbar.propTypes = {
    title: PropTypes.string.isRequired
}
Navbar.defaultProps = {
    title: "Default Props"
}
